"use strict";function AnswerFactory(a){this.conceptFactory=a}AnswerFactory.prototype.createAnswer=function(a){if(a.hasQueryanswer())return this.createQueryAnswer(a.getQueryanswer())},AnswerFactory.prototype.buildExplanation=function(a){if(!a)return null;const b=a.getQueryanswerList().map(b=>this.createQueryAnswer(b));return{queryPattern:()=>a.getQuerypattern(),answers:()=>b}},AnswerFactory.prototype.createQueryAnswer=function(a){const b=new Map;a.getQueryanswerMap().forEach((a,c)=>{b.set(c,this.conceptFactory.createConcept(a))});const c=this.buildExplanation(a.getExplanation());return{get:()=>b,explanation:()=>c}},module.exports=AnswerFactory;